ax.set_ylabel("MSE Value")
ax.set_title("Chart of MSE Values")

for i, rect in enumerate(bar_chart):
    height = rect.get_height()
    ax.annotate('{}'.format(height),
                xy=(rect.get_x() + rect.get_width() / 2, height),
                xytext=(0, 3),
                textcoords="offset points",
                ha='center', va='bottom')

plt.tight_layout()
plt.show()